Sure! Here's an updated LaTeX template for a standard two-column academic article with a single-column abstract and an included image:

```latex
\documentclass[10pt,twocolumn]{article}
\usepackage[margin=1in]{geometry} % set margins
\usepackage{times} % use Times font
\usepackage{amsmath,amssymb} % for math symbols and equations
\usepackage{graphicx} % for including figures
\usepackage{cite} % for managing citations
\usepackage{setspace} % for adjusting line spacing

\begin{document}

\twocolumn[
  \begin{@twocolumnfalse}
    \maketitle
    \begin{abstract}
    Insert abstract here.
    \end{abstract}
  \end{@twocolumnfalse}
]

\section{Introduction}
Insert introduction here.

\section{Background}
Insert background information here.

\section{Methodology}
Insert methodology here.

\section{Results}
Insert results here.

\section{Discussion}
Insert discussion here.

\section{Conclusion}
Insert conclusion here.

\begin{figure}[h]
  \centering
  \includegraphics[width=0.8\linewidth]{example-image.jpg}
  \caption{Example image.}
  \label{fig:example}
\end{figure}

\bibliographystyle{plain}
\bibliography{references} % name of your .bib file

\end{document}
```

This template includes the `twocolumn` documentclass option to create a two-column layout. The included image can be displayed using the `figure` environment, and you can customize the width and placement of the image as needed. Don't forget to replace `example-image.jpg` with the actual file name of your image.

Remember to adjust the formatting and layout according to the specific requirements of the journal you are submitting to.
